import myPhoto1 from '../images/photo1.jpg';

function Main() {
    return(
        <div class='main'>
            <div class='headline'>
                <h1>Junior Developer</h1>
                <h1>& Coffee Enthusiast.</h1>
                <h2>hello</h2>
            </div>
            <img src={myPhoto1} alt="My Image" />
        </div>
    )
}

export default Main;
